sys_variable_value.value:
(function execute(inputs, outputs) {
var needits=JSON.parse(inputs.payload).result;
var numbers=[];
for (var needit in needits)
{
    var obj={
        number:needits[needit].number
    }
    numbers.push(obj)
}
outputs.needit_numbers=JSON.stringify(numbers)

})(inputs, outputs);

